rdnlp/dspy/pull/746', 'diff_url': 'https://github.com/stanfordnlp/dspy/pull/746.diff', 'patch_url': 'https://github.com/stanfordnlp/dspy/pull/746.patch', 'merged_at': None}, 'body': 'This commit introduces changes to the BedrockClaudeV3 class, extending the Bedrock base class. It specifically tailors the _create_body method to handle request body parameters unique to the AWS Bedrock Claude V3 model. This includes the mandatory inclusion of the 'anthropic_version' parameter and structuring the 'messages' parameter to accept prompts as text. Additionally, updates to the _call_model method ensure proper parsing and return of the text outputs from the model responses. The _format_prompt method remains unchanged."

